import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom'
import logo from './logo.svg';
import './App.css';
import 'materialize-css'
import Clients from './Clients/Clients';
import Actions from './Actions/Actions';

function App() {
  return (
<Router>
        <nav>
          <div className="nav-wrapper nav_bar">
            <ul id="nav-mobile" className="left">
              <li><Link to="/api/clients"> Clients </Link></li>
              <li><Link to="./redux/actions"> Actions </Link></li>
            </ul>
          </div>
        </nav>
        <Route exact path='/api/clients' render={() => <Clients data={this.state.data} update={this.update} />} />
        <Route exact path='./redux/actions/redux/actions' render={() => <Actions data={this.state.data} updateClient={this.updateClient} addClient={this.addClient} />} />
      </Router>
  );
}

export default App;
